                  /> */}
                {/* </Col> */}

                {/* </Row> */}
              </Studentmodal>
            </div>
          ) : (
            <Studentdetail studid={stud} backfn={back} />
          )}
        </div>
      </div>
    </Container>
  );
};

export default StudentList;
